import React from "react";
import AddUser from "./Components/AddUser/AddUser";
import UserList from "./Components/UserList/UserList";

function App() {
  const listItemes = [
    {
      id: 1,
      userName: "azar-b",
      age: 30,
    },
    {
      id: 2,
      userName: "m-a",
      age: 31,
    },
  ];
  return (
    <div>
      <AddUser />
      <UserList
        items={listItemes.map((item) => ({
          userName: item.userName,
          age: item.age,
        }))}
      />
    </div>
  );
}

export default App;
